('no-nb', '_template', 'atutor_accessibility_text', '<p>ATutor inneholder en rekke funksjonalitet for å gjøre innhold tilgjengelig for alle brukere, inkludert de med langsom nettforbindelse, eldre weblesere (browsere) og mennesker som bruker assisterende teknologi for å få tilgang til webinnhold. Denne funksjonaliteten er forklart i detalj under. </p>\r\n\r\n<ol>\r\n<li><strong>Passeringslenker</strong>: Øverst i ATutors venstre hjørne finnes en skjult lenke som brukere av assisterende teknologi kan bruke til å hoppe over navigasjonslenkene og direkte til toppen av innholdet. Trykk tabulator når en side har lastet ferdig for å gå til den første skjulte lenken, trykk så enter for å bli satt til direkte til toppen av innholdet. Du kan også benytte denne lenken ved hjelp av en hurtigtast (accesskey). Trykk Alt + C for å hoppe til toppen av innholdet, uavhengig av hvor musepekeren befinner seg på skjermen. <br /><br />\r\n\r\nAndre passeringslenker er bl.a. \"hopp over tabell\" og \"hopp over koder\" som gjør at brukere henholdsvis kan hoppe over tabulære data og til eventuelt innhold under en tabell, samt hoppe over kodene for emotikoner på slutten av siden for å poste meldinger i diskusjonsforumet.  </li>\r\n\r\n<li><strong>Hutigtaster / accesskeys</strong>: Mye av funksjonaliteten i ATutor kan du få tilgang til via tastaturet. Merk at det er forskjeller i hvordan weblesere har implementert hurtigtaster, men det følgende er mest vanlig: I Mozilla / Firefox og Internet Explorer trykker du Alt-tasten og hurtigtasten, i Opera trykker du Shift- og Esc-tasten og hurtigtasten, og på Mac trykker du Control-tasten og hurtignøkkelen. I eksemplene nedenfor brukes Alt-tasten som eksemplel<br /><br />\r\n\r\nGenerelle hurtigtaster:\r\n<ul>\r\n<li>[Alt-1 til Alt-0] Lenker / faner i hovednavigasjon. Disse blir tildelt dynamisk, slik at den første fanen får nøkkelen 1, den andre nøkkelen 2 etc. </li>\r\n<li>[Alt-,] Forrige emne</li>\r\n<li>[Alt-.] Neste emne, samt fortsett</li>\r\n<li>[Alt-j] Hoppmenyen (øverst i høyre hjørne)</li>\r\n<li>[Alt-s] Send inn (tilgjengelig på de fleste sider med innsendingsfelt)</li>\r\n<li>[Alt-c] Hopp til toppen av innhold (hopper over navigasjon)</li>\r\n</ul>\r\nHurtigtaster for innholdseditor\r\n<ul>\r\n<li>[Alt-n] Fane for innhold</li>\r\n<li>[Alt-p] Fane for egenskaper</li>\r\n<li>[Alt-g] Fane for ordboktermer</li>\r\n<li>[Alt-r] Fane for forhåndsvisning</li>\r\n<li>[Alt-a] Fane for tilgjengelighet</li>\r\n<li>[Alt-s] Lagre</li>\r\n</ul>\r\nHurtigtaster for innrulleringsadministrering\r\n<ul>\r\n<li>[Alt-e] Fane for innrullert</li>\r\n<li>[Alt-u] Fane for ikke innrullert</li>\r\n<li>[Alt-a] Fane for tidligere student</li>\r\n</ul>\r\nHurtigtaster for prat / chat\r\n<ul>\r\n<li>[Alt-c] Hopp til forfatt melding</li>\r\n<li>[Alt-r] Forny meldinger</li>\r\n<li>[Alt-m] Hopp til meldingsfelt</li>\r\n<li>[Alt-q] Gå ut av prat</li>\r\n</ul>\r\nHurtigtaster for inbox\r\n<ul>\r\n<li>[Alt-r] Svar på meldinger</li>\r\n</ul>\r\n</li>\r\n\r\n<li><strong>Verifiser tilgjengelighet</strong>: Instruktører kan sjekke tilgjengeligheten på innhold produsert i innholdseditoren. Hurtigtast for dette er Alt + a når inne i editoren.</li>\r\n<li><strong>Alternativ tekst</strong>: Alle meningsbærende bilder har en alternativ tekst som beskriver bildet eller dets funksjon. Hvis bilder ikke er meningsbærende gis en tom alternativ tekst så bildet blir ignorert av assisterende teknologi. </li>\r\n<li><strong>Alternativ navigasjon</strong>: Global, hierarkisk og sekvensiell navigasjon er tilgjengelig, så brukere kan strukturere innhold på den måten som best passer dem. I tillegg finnes et sidekart hvor alt innhold er tilgjengelig fra én plass. </li>\r\n<li><strong>Fortsett visning</strong>: Systemet husker hvilken side du sist så på av læringsinnhold, så du kan fortsette der du slapp om du skulle gå ut av læringsinnholdet og eksempelvis inn i diskusjonsforumet. Dette huskes også mellom sesjoner. Man kan trykke lenken for fortsett funnet både under \"mine kurs\" og når man har gått inn i et kurs. I tillegg vil hurtigtasten Alt-. gå til siste innholdsside.</li>\r\n<li><strong>Skjul menyer</strong>: For brukere med eldre assisterende teknologi som ikke støtter innhold presentert i tabeller er det mulig å skjule innholdsnavigasjonen. På denne måten blir innholdet presentert lineært, og dette frigjør også plass for brukere med mindre skjermer. </li>\r\n<li><strong>Søk og sorter</strong>: De fleste datatabeller har et søkeverktøy eller filter for å kunne redusere mengden data presentert på en gang. De fleste tabeller kan også sorteres per kolonne, som også frigjør plass. </li>\r\n<li><strong>Tabelltoppforbindelser</strong>: Alle datatabeller er markert med TH-elementet og SCOPE-attributtet så brukere av skjermlesere kan navigere gjennom, og forstå hva hver tabellcelle inneholder. </li>\r\n<li><strong>Labels for innsendingsfelt / forms</strong>: Alle innsendingsfelt (forms) er markert med LABEL-elementet. Dette sikrer at at alle innsendingsfelt er tilstrekkelig beskrevet for brukere av assisterende teknologi, og skaper også et større målområde for musepekeren så det er lettere å huke av sjekkbokser og annet. </li>\r\n<li><strong>Stilsett / CSS</strong>: Hvor det er mulig er all presentasjon av innhold og funksjonalitet styrt av CSS. Dette gir brukere mulighet til lett å kontrollere presentasjonen av systemet. </li>\r\n<li><strong>Fokus i innsendingsfelt</strong>: På sider hvor primært innhold er et innsendingsfelt vil musepekeren automatisk plasseres i det første feltet, så brukere kan begynne inntasting med det samme. Brukere kan slå dette av i sine innstillinger om det ikke er ønsket av forskjellige grunner. </li>\r\n<li><strong>Relativ størrelse på bilder</strong>: Ikoner i systemet kan forstørres for brukere med weblesere som støtter relativ forstørring av bilder. Hvor det er mulig har relative måleenheter blitt brukt i systemet, så forstørring og forminsking av brukergrensesnittet skjer på best mulig måte. </li></ol>', '2017-04-04 15:33:43', ''),
