('no-nb', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> er et webbasert <strong>Learning Content Management System (LCMS)</strong> basert på åpen kildekode, med fokus på tilgjengelighet og tilpasningsdyktighet. Administratorer kan installere eller oppdatere ATutor på få minutter. Lærere kan hurtig samle, pakke og distribuere læringsinnhold, og holde kurs på nettet. Studenter lærer i et tilpasningsdyktig læringsmiljø.', '2017-04-04 15:35:04', ''),
('no-nb', '_template', 'atutor_links', '<p>Lær mer om <a href=\"http://atutor.ca/index.php\">ATutor</a> ved å se gjennom følgende sider:</p> <ul> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Ofte spurte spørsmål</li> <li><a href=\"http://atutor.ca/forums/index.php\">Supportforum</a> - Skriv i brukerforumene</li> <li><a href=\"http://atutor.ca/services/index.php\">Support-tjenester</a> - Support er tilgjengelig om du skulle trenge det</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Oversetting</a> - last ned språkpakker, bli en oversetter</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Lisens</a> - Programvaren er tilgjengelig helt gratis, under visse betingelser</li> <li><a href=\"http://atutor.ca/atutor/download.php\">Last ned ATutor</a> - All nødvendig programvare for å kjøre ATutor kan lastes ned her</li> </ul>', '2008-06-26 09:39:26', ''),
